function CartWidget() {
  return (
    <>
      <a href="#">
        <img
          src="https://www.creativefabrica.com/wp-content/uploads/2019/04/Shopping-cart-icon-by-marco.livolsi2014-8-580x386.jpg"
          style={{ width: 50, height: 50, float: "right" }}
          alt="cart"
        />
      </a>
    </>
  );
}

export default CartWidget;
